import pokemon_logo from "./pokemon_logo.jpg";
import "./App.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import Header from "./components/Header";
import Home from "./pages/Home";
import Pokedex from "./pages/Pokedex";
import Mad_libs from "./pages/Mad_libs";
import Footer from "./components/Footer";
import React, { useState, useEffect } from "react";

function App() {
  const url = "https://pokeapi.co/api/v2/pokemon/clefairy";
  const [data, setData] = useState([]);

  const fetchInfo = () => {
    return fetch(url)
      .then((res) => res.json())
      .then((d) => setData(d));
  };

  useEffect(() => {
    fetchInfo();
  }, []);

  return (
    <>
      <Router>
        <Switch>
          <Route exact path="/" pages={Home} />
          <Route path="/pokedex" pages={Pokedex} />
          <Route path="/mad_libs" pages={Mad_libs} />
          {/* <Redirect to="/" /> */}

          <div className="App">
            <Header />
            {/* <header className="App-header"> */}
            {/* <img src={pokemon_logo} className="App-logo1" alt="logo1" /> */}
            {/* <p>
          Text <code>src/App.js</code> text text text.
        </p>
        <p>Name: {data.name}</p>
        <p>Base Experience: {data.base_experience}</p>
  <p>Weight: {data.weight}</p>*/}
            <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              Enter Here
            </a>
            {/* </header> */}
            <Home />
            <Footer />
          </div>
        </Switch>
      </Router>
    </>
  );
}

export default App;

